import './App.css';
import SuccessInfo from './components/successInfo';
import { PieChart } from 'react-minimal-pie-chart';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className='pie-chart'>
          <PieChart
            data={[
              { title: 'Success Consults', value: 25, color: '#E38627' },
              { title: 'Not Success Consults', value: 15, color: '#C13C37' }
            ]}
          />;
          <h4></h4>
        </div>
        {/* <SuccessInfo /> */}
      </header>
    </div>
  );
}

export default App;
